import React from 'react';
import { Layout } from './Layout';
import { Image } from 'react-native';
import { useAuth } from '../../../hooks/useAuth';

export const PlaceImages = ({ navigation, images, placeId }) => {
    const [activeIndex, setActiveIndex] = React.useState(0);
    const {token} = useAuth();

    const renderItem = ({item}) => {
        return (
            <Image source={{uri: 'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAADMAAAAzCAYAAAA6oTAqAAAAEXRFWHRTb2Z0d2FyZQBwbmdjcnVzaEB1SfMAAABQSURBVGje7dSxCQBACARB+2/ab8BEeQNhFi6WSYzYLYudDQYGBgYGBgYGBgYGBgYGBgZmcvDqYGBgmhivGQYGBgYGBgYGBgYGBgYGBgbmQw+P/eMrC5UTVAAAAABJRU5ErkJggg=='}} style={{height: 200, width: 300}} />
        );
    }

    return <Layout 
        placeId={placeId} 
        navigation={navigation} 
        activeIndex={activeIndex} 
        setActiveIndex={setActiveIndex} 
        images={images} 
        renderItem={renderItem} 
        token={token} />
}
